artists.bio:
Mike Kuster&#39;s albums and songwriting reflect the classic traditional country music he grew up hearing. His music earned him The Independent Music Network named Mike its Country Impact Artists of 2022, and awarded &#34;<a href="spotify:track:38SmV4aVScQWU57xC2SWWC" data-name="Daddy&#39;s Blue Jean Jacket">Daddy&#39;s Blue Jean Jacket</a>&#34; Song of the Year for 2021. 

 <a href="spotify:playlist:0tRfwseQwICxjynjpmCpen" data-name="Country Music France Top 30 playlist">Country Music France Top 30 playlist</a> summarized Mike&#39;s latest album, &#34;If country music means relatable songs about real life, authenticity, quality of the songwriting and of course excellent instrumentation, then &#39;<a href="spotify:album:0HsM2ejgiIVZvMKhD7xwxF" data-name="Country So Fresh You Have To Check Your Boots">Country So Fresh You Have To Check Your Boots</a>&#39; is an album perfectly representative of the genre, that will be highly appreciated by all those who love traditional country.&#34;

Mike&#39;s debut album, <a href="spotify:album:1SmHhWlj51UIe1hNI33Gtr" data-name="Better Late Than Never">Better Late Than Never</a>, was named one of 2022&#39;s Essential Albums by <a href="spotify:playlist:7mfYm0btgVvLXdeC7wiV7K" data-name="Saving Country Music&#39;s Top 25 Current Playlist">Saving Country Music&#39;s Top 25 Current Playlist</a>, The Balcony Show, and <a href="spotify:playlist:0tRfwseQwICxjynjpmCpen" data-name="Country Music France Top 30 playlist">Country Music France Top 30 playlist</a>. 

Dr. Ford produced both of Mike&#39;s albums in Nashville. They recruited some of the best musicians around to support Mike&#39;s songs. They include Chris Condon (guitars), Caleb Mundy (bass guitar), <a href="spotify:artist:1Qjp7X9DkOL5ZZ9atAKxK6" data-name="Smith Curry">Smith Curry</a> (pedal steel guitar and dobro), Gary Carter (steel guitar), and <a href="spotify:artist:1l5b0hxCDTDF6cXYa3h5wk" data-name="Michael Cleveland">Michael Cleveland</a> (fiddle and mandolin). 

<a href="spotify:playlist:7mfYm0btgVvLXdeC7wiV7K" data-name="Saving Country Music&#39;s Top 25 Current Playlist">Saving Country Music&#39;s Top 25 Current Playlist</a> wrote, &#34;To sing country, you have to live country, and that’s what makes the music of Mike Kuster so much more meaningful. It comes with that real life, lived-in and loved aspect that you just don’t get from the antiseptic and formulaic notions of big radio singles.&#34;
